const gymgraphStyle = theme => ({
    paper: {
        height: "inherit",
    },
    chart: {
        paddingTop: "2rem"
    },
    modal: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
    autocomplete: {
        marginTop: "16px",
        marginLeft: "72px"
    }
})

export default gymgraphStyle;
